import { ProductosForm } from "./ProductosForm";

const ListaProductos = () => {
    return (
      <div>   
          <h2>Lista de Productos</h2>
          <ProductosForm />
          <ul>
              <li>Producto 1 - $100 - Cantidad: 2</li>
  
                <li>Producto 2 - $200 - Cantidad: 1</li>
            </ul>

      </div>
    );
  }

  export default ListaProductos;
